import React, { useState} from 'react';
import { useNavigate } from 'react-router-dom';

export default function SignUp() {
  const [emailError, setEmailError] = useState(false);
  const [emailErrorMessage, setEmailErrorMessage] = useState('');
  const [passwordError, setPasswordError] = useState(false);
  const [passwordErrorMessage, setPasswordErrorMessage] = useState('');
  const [nameError, setNameError] = useState(false);
  const [nameErrorMessage, setNameErrorMessage] = useState('');
  const navigate = useNavigate();

  const validateInputs = () => {
    const email = document.getElementById('email');
    const password = document.getElementById('password');
    const name = document.getElementById('name');

    let isValid = true;

    if (!email.value || !/\S+@\S+\.\S+/.test(email.value)) {
      setEmailError(true);
      setEmailErrorMessage('Please enter a valid email address.');
      isValid = false;
    } else {
      setEmailError(false);
      setEmailErrorMessage('');
    }

    if (!password.value || password.value.length < 6) {
      setPasswordError(true);
      setPasswordErrorMessage('Password must be at least 6 characters long.');
      isValid = false;
    } else {
      setPasswordError(false);
      setPasswordErrorMessage('');
    }

    if (!name.value || name.value.length < 1) {
      setNameError(true);
      setNameErrorMessage('Name is required.');
      isValid = false;
    } else {
      setNameError(false);
      setNameErrorMessage('');
    }

    return isValid;
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    console.log({
      name: data.get('name'),
      lastName: data.get('lastName'),
      email: data.get('email'),
      password: data.get('password'),
    });
  };

  const handleSignInRedirect = () =>{
    navigate('/sign-in');
  }
  return (
    <div style={{ padding: '20px', marginTop: '10vh', backgroundColor:'red'}}>
      <div style={{ maxWidth: '415px',maxHeight:'615px', margin: 'auto', padding: '20px', boxShadow: '0 5px 15px rgba(0, 0, 0, 0.1)', backgroundColor: 'white' }}>
        <div className="sitemark-icon"> {/* Replace with your own icon or image */} </div>
        <h1 style={{ fontSize: '2rem', textAlign: 'center' }}>Sign up</h1>
        <form onSubmit={handleSubmit} noValidate style={{ display: 'flex', flexDirection: 'column', gap: '16px' }}>
          <div style={{ display: 'flex', flexDirection: 'column' }}>
            <label htmlFor="name">Full name</label>
            <input
              type="text"
              id="name"
              name="name"
              placeholder="Jon Snow"
              required
              style={{ padding: '8px', borderColor: nameError ? 'red' : '#ccc' }}
            />
            {nameError && <span style={{ color: 'red' }}>{nameErrorMessage}</span>}
          </div>
          <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              name="email"
              placeholder="your@email.com"
              required
              style={{ padding: '8px', borderColor: emailError ? 'red' : '#ccc' }}
            />
            {emailError && <span style={{ color: 'red' }}>{emailErrorMessage}</span>}
          </div>
          <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
            <label htmlFor="password">Password</label>
            <input
              type="password"
              id="password"
              name="password"
              placeholder="••••••"
              required
              style={{ padding: '8px', borderColor: emailError ? 'red' : '#ccc' }}
            />
            {passwordError && <span style={{ color: 'red' }}>{passwordErrorMessage}</span>}
          </div>
          <button
            type="submit"
            style={{ padding: '10px', backgroundColor: 'blue', color: 'white', border: 'none', cursor: 'pointer' }}
            onClick={validateInputs}
          >
            Sign up
          </button>
          <p style={{ textAlign: 'center' }}>
            Already have an account?{' '}
            <a href='/sign-in'
            onClick={handleSignInRedirect} style={{ color: 'blue' }}
          >
            Sign in</a>
          </p>
        </form>
        <div className="divider">
          <span>or</span>
        </div>
        <div className="social-buttons">
          <button
            className="social-button google"
            onClick={() => alert('Sign up with Google')}
          >
            Sign up with Google
          </button>
          <button
            className="social-button facebook"
            onClick={() => alert('Sign up with Facebook')}
          >
            Sign up with Facebook
          </button>
        </div>
      </div>
    </div>
  );
}
